import 'bootstrap/dist/css/bootstrap.min.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import { TopNav } from './components/navbar';
function App() {
  return (
    <div>
      <BrowserRouter>
        <TopNav></TopNav>
        <Routes>
          <Route></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
